import React from 'react';
import './App.css';
import Row from './Row';
import requests from "./requests";

function App() {
  return (
    <div className="app">
      <h1>Hey Smalawad let build netflix build frontend today!</h1>
      <Row 
        title="NETFLIX ORIGINALS" fetchURL={requests.fetchNetflixOriginals}
      />
      <Row title="Trending Now" fetchURL={requests.fetchTrending}/>
      <Row title="Top Rated" fetchURL={requests.fetchTopRated}/>
      <Row title="Action Movies" fetchURL={requests.fecthActionMovies}/>
      <Row title="Comedy Movies" fetchURL={requests.fetchComedyMovies}/>
      <Row title="Horror Movies" fetchURL={requests.fetchHorrorMovies}/>
      <Row title="Romance Movies" fetchURL={requests.fetchRomanceMovies}/>
      <Row title="Document Movies" fetchURL={requests.fetchDocumentaries}/>

    </div>
  );
}

export default App;
